                    "value": "<div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-weight:bold;font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">The system consists of the following key components:</span></div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-weight:bold;font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">Arduino Uno Microcontroller:</span><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">&nbsp;The control unit that reads analog input from the potentiometer, processes it, and generates corresponding PWM signals to control motor speed.</span></div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-weight:bold;font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">L293D Motor Driver IC:</span><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">&nbsp;Acts as an interface between the Arduino and the DC motor, enabling the motor to operate at varying speeds and directions. It can handle higher currents required by the motor, which the Arduino alone cannot supply directly.</span></div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-weight:bold;font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">DC Motor:</span><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">&nbsp;The output device whose speed is controlled based on user input. The motor can be used to drive fans, pumps, conveyor belts, or robotic wheels.</span></div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-weight:bold;font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">Potentiometer:</span><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">&nbsp;A user input device that allows for manual control of motor speed by adjusting the resistance. Rotating the potentiometer changes the analog input signal, which the Arduino reads and maps to a PWM output.</span></div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-weight:bold;font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">16x2 LCD Display:</span><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">&nbsp;Provides real-time feedback by displaying the motor's current speed, allowing users to easily monitor and adjust the settings.</span></div></div>",
