                    "key": "Response",
                    "value": "<div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">The user controls the motor speed by rotating the potentiometer. The potentiometer is connected to one of the analog pins on the Arduino.</span></div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">As the potentiometer rotates, it changes the resistance, which alters the voltage level read by the analog pin. This analog value (ranging from 0 to 1023) is used as the input for speed control. The Arduino processes this input and maps it to a PWM signal range (0 to 255), which determines the duty cycle of the signal. Higher values result in a longer \"on\" time, increasing motor speed, while lower values reduce it.</span></div></div>",
