                    "value": "<div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"font-size:12.0pt;line-height:28.5px;r-font-family:'Times New Roman';\">The name PID controller stands for Proportional- Integral Controller. PID controller contains basic algorithms i.e. Proportional mode, Integral mode and Derivative mode.The gain of proportional control is Kp. Proportion controller is directly proportional to error value i.e. difference between process variable and set point. This controller reduce the error but does not eliminate error value. To element the present error, we used Integral controller. In this controller we can adjust the integral time. In the Integral controller the output of controller is directly proportional to the integral of error of error with respect to time. The next mode is Derivative controller. Derivative controller decreases overshoot caused due to integral controllers fast response. Td is the derivative rate time which is used to control the derivative controller action. PID in continuous time form can be stated as The above plot shows that the proportional controller reduced both the rise time and the steady-state error, increased the overshoot, and decreased the settling time by a small amount.</span></div></div>",
