            "question": "PROPOSEDSYSTEM \nThe proposed system speed control of pmdc motor is implemented here, A scheme that address on building up such a system as mention above is presented here. As the system is based on speed of PMDC motor, so desired goal is to achieve a system with control speed and direction of rotation at constant load condition. That means motor will run at variable speed at constant load condition. In implementing this work frequency independent PWM output with variable duty cycle from 0% to 100% is generated. Furthermore an direction change logic circuit is fabricated for the changing the direction of motor (forward and reverse). Also, there is use of soft start circuit, to protect the motor from inrush current.",
            "linkId": "",
            "contentScore": -1,
