            "answerMatch": [
                "<div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"r-font-family:'Times New Roman';\">The PMDC motor to be controlled is fed by DC source through a 4-quadrant chopper circuit. The output voltage of chopper is fed to the PMDC motor which ro..."
            ],
            "answers": [
                {
                    "key": "Response",
                    "value": "<div><div style=\"text-transform:initial;font-size:11.0pt;line-height:27.0px;margin-top:0px;margin-bottom:11px;r-font-family:'Calibri';text-align:justify;\"><span style=\"r-font-family:'Times New Roman';\">The PMDC motor to be controlled is fed by DC source through a 4-quadrant chopper circuit. The output voltage of chopper is fed to the PMDC motor which rotate in forward and reverse direction according to the conduction of chopper pair. With the help of tachometer, we can measure the speed of motor in RMP along with direction of rotation. The circuit is based on PWM techniques. LM3524 provide desired DC level. By adjusting the register valve the duty cycle can be controlled. When motor run at 20% duty cycle the output, voltage develop across chopper is less which in turn makes the speed of motor to be les s but for 70% duty cycle the speed of motor get increased. This increase or decreased speed is sensed by tachometer. But if any load occurs , the speed of motor get decreased for the same duty cycle. Also, the direction of PMDC motor can be change with the help of direction change logic circuit. If the motor rotate in forward direction then after switching this switch the motor will rotate in reverse direction. The control of the armature currents is done with the help of MOSFET power circuit. Due to the MOSFET power circuit the motor is rotated in both the direction. Thus, there is forward and reverse regenerative breaking takes place.</span></div></div>",
                    "type": "RICH_TEXT",
                    "mergeTag": ""
                }
            ],
